import { useState } from "react";
import {} from "@chakra-ui/react";
import InputField from "../InputField";
import ButtonAdd from "../Button";

const FormElement = (props) => {

  const [name, setName] = useState("");
  const [email, setEmail] = useState("");
  const [age, setAge] = useState("");
  const [cpf, serCpf] = useState("");

  const onSave = (e) => {
    e.preventDefault();
    props.onRegister({
      name,
      email,
      cpf,
    });
    console.log(name, email, cpf)
  }

  return(
    <Form h="100vh" align="center" justify="center" bg="#333">
          <InputField
            label="Nome"
            required={true}
            type="text"
            value={name}
            inputChange={value => setName(value)}
          />

          <InputField
            label="E-mail"
            required={true}
            type="email"
            value={email}
            inputChange={value => setEmail(value)}
          />

          <InputField
            label="CPF"
            required={true}
            type="number"
            value={cpf}
            inputChange={value => serCpf(value)}
          />
      
          <InputField
            label="Idade"
            required={true}
            type="number"
            value={age}
            inputChange={value => setAge(value)}
          />
        <ButtonAdd>Adicionar</ButtonAdd>
    </Form>
  );
}

export default FormElement;
